import React from "react";
import flovers from "./flover_type/flovers.json";

export const FloverOptions = () => {
  const floverList = [...flovers];

  return flover.map((count, number) => {
    <div>
      <img src={`bouquet_${number}`.img_src} alt={`bouquet_${number}`.name} />
      <span>{flovers.name}</span>
      <select
        name="Number of flovers"
        class="ChoosingFlowers__container__select"
      >
        {floverList.map((count, number) => {
          return <option value={options[`option_${number}`]}>{count}</option>;
        })}
      </select>
    </div>;
  });
};
